import logo from './logo.svg';
import './App.css';
import './css/fonts/fontawesome-free-6.2.0/css/all.min.css'
import { useState } from 'react';
import SignupUser from './signupU';
import SigninUser from './signin';


function App() {
  const [UserPop,setUserPop] = useState(false);
  const [Signin,setSignin] = useState(false);
  const [Signup,setSignup] = useState(true);
  return (
    <div className="App">

      <button onClick={() => setUserPop(!UserPop)} className='App-login'>
        <div className='App-login-text'> 
            Người dùng
        </div>
        <i className='App-login-icon fa-solid fa-user'></i>
      </button>
      <SignupUser trigger={UserPop} singup={Signup} setTrigger={setUserPop} />     
      <SigninUser trigger={UserPop} setTrigger={setUserPop} />

      <button className='App-login'>
        <div className='App-login-text'> 
            Tài xế
        </div>
        <i className='App-login-icon fa-solid fa-motorcycle'></i>
      </button> 

      <button className='App-login'>
        <div className='App-login-text'> 
            Đối tác
        </div>
        <i className='App-login-icon fa-sharp fa-solid fa-shop'></i>
      </button>  

    </div>
  );
}

export default App;
